// SPDX-License-Identifier: MIT
pragma solidity ^0.4.25;
import "./Roles.sol";
//零售商角色
contract Retailer{
    using Roles for Roles.Role;
    event RetailerAdded(address indexed account);
    event RetailerRemoved(address indexed account);
    Roles.Role private _retailers;

    constructor(address retailer)public{
        _addRetailer(retailer);
    }

    modifier onlyRetailer(){
        require(isRetailer(msg.sender),"RetailerRole:caller does not have theRetailer role");
        _;
    }

    function isRetailer(address account)public view returns(bool){
        return _retailers.has(account);
    }

    function addReatiler(address account)public onlyRetailer{
        _addRetailer(account);
    }

    function renounceRetailer()public{
        _removeRetailer(msg.sender);
    }


    function _addRetailer(address account)internal{
        _retailers.add(account);
        emit RetailerAdded(account);
    }

    function _removeRetailer(address account)internal{

        _retailers.remove(account);
        emit RetailerRemoved(account);
    }

}

